          <a className="bg-red-400 text-white p rounded font-bold">Home</a>
        <div className=' grid-2-5 mt-4'>
          <div className=' bg-blue-400 flex flex-col justify-center items-center '>
            <img src="../logo.png" alt="profile picture" />
          </div>
          <div className=' bg-yellow-400 '>main</div>
        </div>
      </div>
    </div>
  );
};

export default profile;
